import React from 'react';
import logo from './logo.svg';
import './App.css';

function userProfile() {
  return (
    <div>
      Hello
    </div>
  );
}
function historyBar() {
  return (
    <div>
      Hello
    </div>
  );
}

function backButton() {
  return (
    <div>
      Hello
    </div>
  );
}

function profileSideBar() {
  return (
    <div>
      <userProfile />
      <historyBar />
      <backButton />
    </div>
  );
}

function App() {
  return (
    <div className="App">
      Hello
    </div>
  );
}

export default App;
